import './App.css';

function App() {

  fetch('https://imdb146.p.rapidapi.com/v1/find/?query=brad',{
    "method": "GET",
    "headers": {
      "X-RapidAPI-Key": "65e845c99fmshfb7070778d6ea7fp1c7901jsn4ba7a127ff3f",
      "X-RapidAPI-Host": "imdb146.p.rapidapi.com"
    }
  })

.then(response =>{
  console.log(response.json());

})
.catch(err =>{
  console.error(err);
})

  return (
    <div className="App">

    <form>
      <input type="text"/>
      <button type="button">Submit</button>
    </form>

    </div>
  );
}

export default App;
